def hexnyb(n):
    return "0123456789abcdef"[n]

def hexbyte(b):
    a = (b >> 4) & 15
    b = b & 15
    return hexnyb(a) + hexnyb(b)

def hex(data):
    res=[]
    for b in struct.unpack(str(len(data))+"B", data):
        res.append(hexbyte(b))
    return "".join(res)
