            self.__haveOpenFiles = True

            self.__openfiles = {}

            p = subprocess.Popen(["C:\\Windows\\System32\\openfiles.exe","/query","/fo","CSV","/v"], stdout=subprocess.PIPE)
            psout=[]
            if sys.version[0] == '3':
                with io.TextIOWrapper(p.stdout) as pin:
                    for line in pin:
                        if line[0] == '"':
                            psout.append(line.rstrip())
            else:
                for line in p.stdout:
                    if line[0] == '"':
                        psout.append(line.rstrip())

