class Docker:

    def getContainerList(self):
        cmd = ("docker", "ps", "--format", "{{.ID}}")
        return self.runpipe(cmd)

    def getImageList(self):
        cmd = ("docker", "images", "--format", "{{.ID}}")
        return self.runpipe(cmd)

    def getVolumeList(self):
        cmd = ("docker", "volume", "ls", "--format", "{{.Name}}|{{.Mountpoint}}")
        return self.runpipe(cmd)

    def runpipe(self,cmd):
        p = subprocess.Popen(cmd, stdout=subprocess.PIPE)
        lines=[]
        if sys.version[0] == '3':
            with io.TextIOWrapper(p.stdout, encoding="utf-8") as pin:
                for line in pin:
                    line = line.rstrip()
                    lines.append(line)
        else:
            for line in p.stdout:
                line = line.rstrip()
                lines.append(line)
        p.wait()
        return lines
                    
