class Report:

    #
    # Convert a record to a pseudo-text record:
    #
    # 
    #
    @staticmethod
    def toText(rec):
        recType = rec['type']
        recID = rec['name']

        result=[]
        id = recType + ':' + recID
        result.append(id)
        if 'versions' in rec:
            vinfo=[]
            for vrec in rec['versions']:
                analytics = ','.join(vrec['analytics'])
                vid = vrec['version']
                vinfo.append('version:'+vid + ' [' + analytics + ']')
                if 'cve' in vrec:
                    cset = sorted(vrec['cve'], key=lambda x: x['score'], reverse=True)
                    cve = ['/'.join([c['id'],c['level'],str(c['score'])]) for c in cset]
                    vinfo.append(cve)
            result.append(vinfo)
                        
        if 'children' in rec:
            children=[]
            for c in rec['children']:
                children.append(Report.toText(c))
            result.append(children)
                
        return result

    @staticmethod
    def toStrings(rec, indent):
        if indent == 0:
            space=''
            spacen=''
        else:
            sp1 = '   +--> '
            set1 = []
            if indent > 1:
                [set1.append(' ' * 5) for x in range(0,indent-2)]
            set1.append(sp1)
            space = ''.join(set1)
        result=[]

        numRec = len(rec)-1
        recNum = 0
        for f in rec:
            if type(f) == type("") or type(f) == type(u''):
                result.append(space + f)
            else:
                hasPlus=None
                for s in Report.toStrings(f, indent+1):
                    if recNum == numRec:
                        result.append(s)
                    elif hasPlus is None:
                        n = s.find('+')
                        if n != -1:
                            hasPlus = n
                        result.append(s)
                    else:
                        n = s.find('+')
                        if n != hasPlus:
                            s = s[0:hasPlus] + '|' + s[hasPlus+1:]
                            result.append(s)
                        else:
                            result.append(s)
            recNum = recNum + 1
                            
        return result

    @staticmethod
    def toString(rec):
        lines = Report.toStrings(Report.toText(rec), 0)
        return "\n".join(lines)

        
